SELECT COALESCE(AD.[Date],DA.[Date]) AS [Date] ,ISNULL(DD.[SK_Date],0) AS [SK_Date] --,[Withings_DailyDistance in meter] --,[Oura_DailyDistance in meter] ,CASE -- From SQL Server 2022 the function GREATEST can be used instead WHEN [Oura_DailyDistance in meter] >= ISNULL([Withings_DailyDistance in meter],0) THEN [Oura_DailyDistance in meter] ELSE [Withings_DailyDistance in meter] END AS [DailyDistance (m)] --,[Oura_DailySteps] --,[Withings_DailySteps] ,CASE -- From SQL Server 2022 the function GREATEST can be used instead WHEN [Oura_DailySteps] >= ISNULL([Withings_DailySteps],0) THEN [Oura_DailySteps] ELSE [Withings_DailySteps] END AS [DailySteps] ,COALESCE([Withings_DailyCaloriesPassive],(SELECT AVG([Withings_DailyCaloriesPassive]) FROM [stg].[Withings_AggregatesCaloriesPassive_Clean])) AS [DailyCaloriesPassive] -- ,[Oura_DailyCaloriesActive] --,[Withings_DailyCaloriesActive]
